  return (
    <>
      {/* <ul className="list-inline NavBar"> */}
        {navBarList && navBarList((item, index) => (
          // <li className="active NavBarItems" key={index}>
          <span className="NavBarItems ColumnNav">
            {item}
          </span>
        // </li>
        ))}
      {/* </ul> */}
    </>
  );
};

export default NavBar;
